import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = ([title]) => {
    return (
        <li>
            <Link href={`/post?title=${title}`}>
                <a>{title}</a>
            </Link>
        </li>
    );
}

const Index = () => {
    return (
        <Layout>
            <h3>My Blog</h3>
            <ul>
               <PostLink title="「Hello World」表示" />
               <PostLink title="初めてのNextアプリ" /> 
            </ul>
        </Layout>
    );
}

export default Index;
